 void Detecter::receiveFromCam(const sensor_msgs::ImageConstPtr& image)
{

  try
  {
    Detecter::cv_image_ = boost::make_shared<cv_bridge::CvImage>(*cv_bridge::toCvShare(image, image->encoding));
    REPEAT = true;
  }
  catch (cv_bridge::Exception& e)
  {
    ROS_ERROR("cv_bridge exception: %s", e.what());
    return;
  }


}


 bool Detecter::getCam(cv_bridge::CvImagePtr &cv_image, sensor_msgs::CameraInfoConstPtr &cam_info) {
  if (cv_image_ == nullptr)
    return false;
  if (!Detecter::cv_image_->image.empty() && REPEAT) {
    cv_image = Detecter::cv_image_;
    cam_info = Detecter::info_;
    REPEAT = false;
    return true;
  } else
    return false;
}


