     void Detecter::generateYoloxProposals(std::vector<GridAndStride> g_grid_strides, const float* feat_ptr, float prob_threshold, std::vector<Object>& objects)
    {

        const int num_anchors = g_grid_strides.size();

        for (int anchor_idx = 0; anchor_idx < num_anchors; anchor_idx++)
        {
            const int grid0 = g_grid_strides[anchor_idx].grid0;
            const int grid1 = g_grid_strides[anchor_idx].grid1;
            const int stride = g_grid_strides[anchor_idx].stride;

            const int basic_pos = anchor_idx * (NUM_CLASSES + 5);

            // yolox/models/yolo_head.py decode logic
            //  outputs[..., :2] = (outputs[..., :2] + grids) * strides
            //  outputs[..., 2:4] = torch.exp(outputs[..., 2:4]) * strides
            float x_center = (feat_ptr[basic_pos + 0] + grid0) * stride;
            float y_center = (feat_ptr[basic_pos + 1] + grid1) * stride;
            float w = exp(feat_ptr[basic_pos + 2]) * stride;
            float h = exp(feat_ptr[basic_pos + 3]) * stride;
            // above all get from model
            float x0 = x_center - w * 0.5f;
            float y0 = y_center - h * 0.5f;

            float box_objectness = feat_ptr[basic_pos + 4];
            for (int class_idx = 0; class_idx < NUM_CLASSES; class_idx++)
            {
                float box_cls_score = feat_ptr[basic_pos + 5 + class_idx];
                float box_prob = box_objectness * box_cls_score;
                if (box_prob > prob_threshold)
                {
                    Object obj;
                    obj.rect.x = x0;
                    obj.rect.y = y0;
                    obj.rect.width = w;
                    obj.rect.height = h;
                    obj.lu=cv::Point2f (x0-(w/2.0),y0+(h/2.0));
                    obj.ld=cv::Point2f (x0-(w/2.0),y0-(h/2.0));
                    obj.ru=cv::Point2f (x0+(w/2.0),y0+(h/2.0));
                    obj.rd=cv::Point2f (x0+(w/2.0),y0-(h/2.0));
                    obj.label = class_idx;
                    obj.prob = box_prob;

                    objects.push_back(obj);
                }

            } // class loop

        } // point anchor loop
    }

     inline float Detecter::intersectionArea(const Object& a, const Object& b)
    {
        cv::Rect_<float> inter = a.rect & b.rect;
        return inter.area();
    }

     void Detecter::qsortDescentInplace(std::vector<Object>& faceobjects, int left, int right)
    {
        int i = left; // num on object the init one
        int j = right; // num on object the last one
        float p = faceobjects[(left + right) / 2].prob; // middle obj 's prob

        while (i <= j)
        {
            while (faceobjects[i].prob > p)
                i++;

            while (faceobjects[j].prob < p)
                j--;

            if (i <= j)
            {
                // swap
                std::swap(faceobjects[i], faceobjects[j]);

                i++;
                j--;
            }
        }  //doing the sort work  the biggest pro obj will be seted on the init place

#pragma omp parallel sections
        {
#pragma omp section
            {
                if (left < j) qsortDescentInplace(faceobjects, left, j);
            }
#pragma omp section
            {
                if (i < right) qsortDescentInplace(faceobjects, i, right);
            }
        }
    }

     void Detecter::qsortDescentInplace(std::vector<Object>& objects)
    {
        if (objects.empty())
            return;

        qsortDescentInplace(objects, 0, objects.size() - 1);
    }

     void Detecter::nmsSortedBboxes(const std::vector<Object>& faceobjects, std::vector<int>& picked, float nms_threshold)
    {
        picked.clear();

        const int n = faceobjects.size();

        std::vector<float> areas(n);
        for (int i = 0; i < n; i++)
        {
            areas[i] = faceobjects[i].rect.area();
        }

        for (int i = 0; i < n; i++)
        {
            const Object& a = faceobjects[i];
            int keep = 1;
            for (int j = 0; j < (int)picked.size(); j++) //
            {
                const Object& b = faceobjects[picked[j]];

                // intersection over union
                float inter_area = intersectionArea(a, b);
                float union_area = areas[i] + areas[picked[j]] - inter_area;
                // float IoU = inter_area / union_area
                if (inter_area / union_area > nms_threshold) //if the obj's iou is larger than nms_threshold it will be filtrated
                    keep = 0;
            }

            if (keep)
                picked.push_back(i);
        }
    }

     void Detecter::decodeOutputs(const float* prob, std::vector<Object>& objects, float scale, const int img_w, const int img_h) {
        std::vector<Object> proposals;
//        std::vector<int> strides = {8, 16, 32};
//        std::vector<GridAndStride> grid_strides;

//        generateGridsAndStride(INPUT_W, INPUT_H, strides, grid_strides);
        generateYoloxProposals(g_grid_strides, prob,  g_bbox_conf_thresh, proposals); // initial filtrate
         if (proposals.empty()) return;
        qsortDescentInplace(proposals);

        std::vector<int> picked;
        nmsSortedBboxes(proposals, picked, g_nms_thresh);
        int count = picked.size();
        objects.resize(count);

        for (int i = 0; i < count; i++)
        {
//        objects[i] = proposals[picked[i]];
            objects[i] = proposals[picked[i]];

            // adjust offset to original unpadded
            float x0 = (objects[i].rect.x) / scale;
            float y0 = (objects[i].rect.y) / scale;
            float x1 = (objects[i].rect.x + objects[i].rect.width) / scale;
            float y1 = (objects[i].rect.y + objects[i].rect.height) / scale;

            // clip
            x0 = std::max(std::min(x0, (float)(img_w - 1)), 0.f);
            y0 = std::max(std::min(y0, (float)(img_h - 1)), 0.f);
            x1 = std::max(std::min(x1, (float)(img_w - 1)), 0.f);
            y1 = std::max(std::min(y1, (float)(img_h - 1)), 0.f);

            objects[i].rect.x = x0;
            objects[i].rect.y = y0;
            objects[i].rect.width = x1 - x0;
            objects[i].rect.height = y1 - y0;
        } // make the real object
    }

